import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ListNhanVien from "./components/listNhanVien";
import CreateNhanVien from "./components/createNhanVien";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={ListNhanVien} />
          <Route exact path="/create" component={CreateNhanVien} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
